import React, { Component } from "react";

class ProjectVideo extends Component {
  state = {};
  render() {
    return (
      <video playsinline autoplay controls muted loop className="w-1/3">
        <source
          src="/img/projectPictures/soloStander/vid1.webm"
          type="video/webm"
        />
        <source
          src="/img/projectPictures/soloStander/vid1.mp4"
          type="video/mp4"
        />
        {/* <source src="movie.ogg" type="video/ogg"> */}
        Your browser does not support the video tag.
      </video>
    );
  }
}

export default ProjectVideo;
